import React, { Component } from 'react';
import ProductTabs from '../Components/ProductTabs';

class Order extends Component{
    constructor(props){
        super(props)
    }
    render(){
        return(
            <div className='py-5 container' style={{marginTop: '64px'}}>
                <h2>Try our best selling cakes and pastries in our store. Enjoy!</h2>
                <ProductTabs {...this.props}/>
            </div>
        )
    }
}

export default Order
